    function exportButton() {
        document.getElementById('processing').classList.add('spinning');
        window.setTimeout(function() {
            var csvData = ToCSV();
            // console.log(csvData);
            var blob = new Blob([csvData], {type: 'text/csv'});
            var a = window.document.createElement('a');
            a.href = window.URL.createObjectURL(blob);
            var filename = getFileName();
            a.download = filename.substr(0, filename.length - 3) +'csv';
            document.getElementById('processing').classList.remove('spinning');
            // Append anchor to body.
            document.body.appendChild(a);
            a.click();

    function getFileName() {
        var metaTags = document.getElementsByTagName("META");
        for (var metaTagIndex=0; metaTagIndex < metaTags.length; metaTagIndex++) {
            var metaTag = document.getElementsByTagName("META")[metaTagIndex];
            var attribute = metaTag.getAttribute("name");
            if (attribute === "isi-csv-file-name") {
                return metaTag.getAttribute("content");
            }
        }
        return "report.htm";
    }

    function ToCSV() {
        var newLine = "\r\n";
        var quote ="\"";
        var csv = "";
        var delimiter = ",";
        var dataTable = document.getElementById("isi-report");
        var rows = dataTable.rows;
        for (var rowIndex=0; rowIndex < rows.length; rowIndex++) {
            var row = rows[rowIndex];
            var cells = row.cells;
            for (var cellIndex=0; cellIndex < cells.length; cellIndex ++) {
                var cell = cells[cellIndex];
                if (cell.previousElementSibling != null)
                    csv += delimiter;

                csv += quote + sanitize(cell.innerText) + quote;
            }
            csv += newLine
        }
        return csv;
    }

    // NOTE: CSV quote escaping and whitespace cleanup
    function sanitize(strValue) {
        return strValue
            .replace(/"/g, "\"\"")
            .replace(/\n/g, " ")
            .replace(/\r/g, " ")
            .replace(/\t/g, " ")
            .trim();
